import React from 'react';

import { Card, CardContent, CardActions, Button, Typography, Avatar } from '@mui/material';

class WheatherCard extends React.Component(){
    constructor(props){
        super(props);
        this.state = {};
    }

    render(){
        return (
          <Card sx={{ minWidth: 275 }}>
            <CardContent>
              <Typography
                sx={{ fontSize: 14 }}
                color="text.secondary"
                gutterBottom
              >
                Word of the Day
              </Typography>
              <Typography variant="h5" component="div"></Typography>
              <Avatar alt='Weather image' ></Avatar>
              <Typography variant="body2">
                well meaning and kindly.
                <br />
                {'"a benevolent smile"'}
              </Typography>
            </CardContent>
            <CardActions>
              <Button size="small">Learn More</Button>
            </CardActions>
          </Card>
        );
    }
}

export default WheatherCard;
